import "./Tag.css";

function Tag(props) {
  const { titre_tag, type_tag } = props;

  if (type_tag === "Cozy") {
    return (
      <div className="kasa-tag">
        <div className="kasa-tag-title">{titre_tag}</div>
      </div>
    );
  }

  if (type_tag === "Canal") {
    return (
      <div className="kasa-tag">
        <div className="kasa-tag-title">{titre_tag}</div>
      </div>
    );
  }

  if (type_tag === "Paris 10") {
    return (
      <div className="kasa-tag">
        <h3 className="kasa-tag-title">{titre_tag}</h3>
      </div>
    );
  }

  return true;
}

export default Tag;
